function isNetworkAccessAllowed() {
  var securitySetting = app.preferences.getPrefAsLong(
    "Main Pref Section",
    "Pref_SCRIPTING_FILE_NETWORK_SECURITY"
  );
  if (securitySetting != 1) {
    alert(
      "This script requires access to writing files and network \nGo to After Effects > Preferences > General and make sure: \n \nAllow Scripts to Write Files and Access Network is checked"
    );
    app.executeCommand(app.findMenuCommandId("General..."));
  } else {
    return securitySetting == 1;
  }
}
function buildUI(thisObject) {
  if (thisObject instanceof Panel) {
    var myPalette = thisObject;
  } else {
    var myPalette = new Window("palette", scriptTitle, undefined, {
      resizeable: true,
    });
  }
  if (myPalette != null) {
    var res =
      "group {orientation:'column', alignment:['fill','top'],\n        headerGroup: Group { orientation: 'stack', alignment:['fill','top'], \n            headerImg: Image {preferredSize:[200,30], alignment:['left','top']},\n        },\n        mainGroup: Group {text:'Layer Offset Setup', orientation:'column', alignment:['fill','top'], alignChildren:['fill','top'], spacing:5 ,\n                orderGroup: Group {orientation:'row', alignment:['fill','top'], spacing:5 ,\n                    orderDropDown: DropDownList {properties:{items:['Ascending', 'Descending', 'Random']}, alignment:['left','top'], preferredSize:[120,25], helpTip:'Determines layer offset order'},\n                    shiftBackwardsBtn: Button {text:'\u2190', alignment:['right','top'], maximumSize:['25','25'], helpTip:'Shifts all selected layers backwards'}, \n                    shiftForwardBtn: Button {text:'\u2192', alignment:['right','top'], maximumSize:['25','25'], helpTip:'Shifts all selected layers forward'}, \n                    helpBtn: Button {text:'?', maximumSize:[25,25], alignment:['right','center']} ,\n                },\n                offsetGroup: Group {orientation:'row', alignment:['fill','top'], spacing:5 ,\n                    instructionText: StaticText {text:'Offset Amount:', alignment:['left','center']} ,\n                    offsetAmount: EditText {text:'12', alignment:['fill','center'], helpTip:'Amount of offset'}, \n                    offsetFormat: DropDownList {properties:{items:['Frames', 'Seconds']}, alignment:['right','top'], preferredSize:['80','25'], helpTip:'Offset Amount units'},\n                },\n                staggerModeGroup: Group {orientation:'row', alignment:['fill','top'], spacing:5 ,\n                    staggerText: StaticText {text:'Stagger Mode: ', alignment:['left','top']} ,\n                    inPointModeBtn: RadioButton {text:'inPoint', alignment:['fill','center'], helpTip:'Staggering will be based off inPoints'} ,\n                    outPointModeBtn: RadioButton {text:'outPoint', alignment:['fill','center'], helpTip:'Staggering will be based off outPoints'} ,\n                },\n                executeGroup: Group {orientation:'row', alignChildren:['fill','top'] ,\n                    offsetLayersBtn: Button {text:'Offset Layers', helpTip:'Offsets the selected layers'}, \n                },\n        },\n     }";
    myPalette.grp = myPalette.add(res);
    var securitySetting = app.preferences.getPrefAsLong(
      "Main Pref Section",
      "Pref_SCRIPTING_FILE_NETWORK_SECURITY"
    );
    if (securitySetting != 1) {
      return;
    } else {
      myFile = new File("~/Desktop/temp1.png");
      myFile.encoding = "BINARY";
      myFile.open("w");
      myFile.write(myBinary);
      myFile.close();
      myPalette.grp.headerGroup.headerImg.image = myFile;
      myFile.remove();
    }
    if (
      app.settings.haveSetting(scriptTitle, "Hide header image") == true &&
      app.settings.getSetting(scriptTitle, "Hide header image") == "true"
    ) {
      myPalette.grp.headerGroup.visible = false;
      myPalette.grp.headerGroup.maximumSize = [0, 0];
      myPalette.layout.layout(true);
    } else {
      myPalette.grp.headerGroup.visible = true;
      myPalette.grp.headerGroup.maximumSize = [200, 30];
      myPalette.grp.headerGroup.alignment = ["left", "top"];
      myPalette.layout.layout(true);
    }
    myPalette.grp.mainGroup.orderGroup.orderDropDown.selection = 0;
    myPalette.grp.mainGroup.offsetGroup.offsetFormat.selection = 0;
    myPalette.grp.mainGroup.staggerModeGroup.inPointModeBtn.value = 1;
    myPalette.grp.mainGroup.orderGroup.shiftForwardBtn.onClick = function () {
      app.beginUndoGroup("Shift Layers Forward");
      var selectedLayers = app.project.activeItem.selectedLayers;
      for (var i = 0; i < selectedLayers.length; i++) {
        if (
          myPalette.grp.mainGroup.offsetGroup.offsetFormat.selection.toString() ==
          "Frames"
        ) {
          var offset =
            myPalette.grp.mainGroup.offsetGroup.offsetAmount.text /
            app.project.activeItem.frameRate;
        } else {
          var offset = myPalette.grp.mainGroup.offsetGroup.offsetAmount.text;
        }
        selectedLayers[i].startTime =
          selectedLayers[i].startTime + Number(offset);
      }
      app.endUndoGroup();
    };
    myPalette.grp.mainGroup.orderGroup.shiftBackwardsBtn.onClick = function () {
      app.beginUndoGroup("Shift Layers Forward");
      var selectedLayers = app.project.activeItem.selectedLayers;
      for (var i = 0; i < selectedLayers.length; i++) {
        if (
          myPalette.grp.mainGroup.offsetGroup.offsetFormat.selection.toString() ==
          "Frames"
        ) {
          var offset =
            myPalette.grp.mainGroup.offsetGroup.offsetAmount.text /
            app.project.activeItem.frameRate;
        } else {
          var offset = myPalette.grp.mainGroup.offsetGroup.offsetAmount.text;
        }
        selectedLayers[i].startTime =
          selectedLayers[i].startTime - Number(offset);
      }
      app.endUndoGroup();
    };
    myPalette.grp.mainGroup.executeGroup.offsetLayersBtn.onClick = function () {
      app.beginUndoGroup("Create Texts");
      var selectedLayers = app.project.activeItem.selectedLayers;
      if (selectedLayers.length == 0 || app.project.activeItem == null) {
        alert("Please select layer(s) first.");
      }
      if (
        myPalette.grp.mainGroup.offsetGroup.offsetFormat.selection.toString() ==
        "Frames"
      ) {
        var offset =
          myPalette.grp.mainGroup.offsetGroup.offsetAmount.text /
          app.project.activeItem.frameRate;
      } else {
        var offset = myPalette.grp.mainGroup.offsetGroup.offsetAmount.text;
      }
      if (
        myPalette.grp.mainGroup.orderGroup.orderDropDown.selection.toString() ==
        "Ascending"
      ) {
        for (var i = selectedLayers.length - 1; i >= 0; i--) {
          if (
            myPalette.grp.mainGroup.staggerModeGroup.inPointModeBtn.value == 1
          ) {
            selectedLayers[i].startTime =
              selectedLayers[i].startTime +
              (app.project.activeItem.time - selectedLayers[i].inPoint);
          }
          if (
            myPalette.grp.mainGroup.staggerModeGroup.outPointModeBtn.value == 1
          ) {
            selectedLayers[i].startTime =
              selectedLayers[i].startTime +
              (app.project.activeItem.time - selectedLayers[i].outPoint);
          }
          selectedLayers[i].startTime =
            selectedLayers[i].startTime +
            (selectedLayers.length - (i + 1)) * offset;
        }
      }
      if (
        myPalette.grp.mainGroup.orderGroup.orderDropDown.selection.toString() ==
        "Descending"
      ) {
        for (var i = 0; i < selectedLayers.length; i++) {
          if (
            myPalette.grp.mainGroup.staggerModeGroup.inPointModeBtn.value == 1
          ) {
            selectedLayers[i].startTime =
              selectedLayers[i].startTime +
              (app.project.activeItem.time - selectedLayers[i].inPoint);
          }
          if (
            myPalette.grp.mainGroup.staggerModeGroup.outPointModeBtn.value == 1
          ) {
            selectedLayers[i].startTime =
              selectedLayers[i].startTime +
              (app.project.activeItem.time - selectedLayers[i].outPoint);
          }
          selectedLayers[i].startTime =
            selectedLayers[i].startTime + i * offset;
        }
      }
      if (
        myPalette.grp.mainGroup.orderGroup.orderDropDown.selection.toString() ==
        "Random"
      ) {
        for (var i = 0; i < selectedLayers.length; i++) {
          if (
            myPalette.grp.mainGroup.staggerModeGroup.inPointModeBtn.value == 1
          ) {
            selectedLayers[i].startTime =
              selectedLayers[i].startTime +
              (app.project.activeItem.time - selectedLayers[i].inPoint);
          }
          if (
            myPalette.grp.mainGroup.staggerModeGroup.outPointModeBtn.value == 1
          ) {
            selectedLayers[i].startTime =
              selectedLayers[i].startTime +
              (app.project.activeItem.time - selectedLayers[i].outPoint);
          }
          selectedLayers[i].startTime =
            selectedLayers[i].startTime + Math.random() * offset;
        }
      }
      app.endUndoGroup();
    };
    myPalette.grp.mainGroup.orderGroup.helpBtn.onClick = function () {
      createHelpWindow();
    };
  }
  myPalette.layout.layout(true);
  myPalette.grp.minimumSize = myPalette.grp.size;
  myPalette.layout.resize();
  myPalette.onResizing = myPalette.onResize = function () {
    this.layout.resize();
  };
  return myPalette;
}
function createHelpWindow() {
  var helpWin = new Window(
    "palette",
    scriptTitle + " " + scriptVersion,
    undefined,
    { resizeable: false }
  );
  if (helpWin != null) {
    var res =
      "group {orientation:'column', alignment:['left','top'],\n\t\t\t\t\t\t\t\thelpTabbedPanel: Panel {type:'tabbedpanel', orientation:'column', alignment:['fill', 'top'] ,\n\t\t\t\t\t\t\t\t    descriptionTab: Panel {type:'tab', text:'Description', alignment:['fill','top'] ,\n\t\t\t\t\t\t\t\t        descriptionTextBox: EditText {alignment:['center','top'], preferredSize:['450','275'], properties:{multiline:true, readonly:true}},\n\t\t\t\t\t\t\t\t    },\n\t\t\t\t\t\t\t\t    settingsTab: Panel {type:'tab', text:'Settings', alignment:['fill','top'], alignChildren:['fill','top'] ,\n\t\t\t\t\t\t\t\t        hideSectionGroup: Panel {text:'Hide Sections', alignment:['fill','top'], alignChildren:['left','top'] ,\n\t\t\t\t\t\t\t\t            hideHeaderImg: Checkbox {text:'Hide header image'},\n\t\t\t\t\t\t\t\t        },\n\t\t\t\t\t\t\t\t    },\n\t\t\t\t\t\t\t\t},\n\t\t\t\t\t\t\t\tbtnGroup: Group {orientation:'row', alignment:['fill','top'], alignChildren:['fill','top'] ,\n\t\t\t\t\t\t\t\t    websiteBtn: Button {text:'Visit CreativeDojo', alignment:['left','top']} ,\n\t\t\t\t\t\t\t\t    checkUpdateBtn: Button {text:'Check for Updates', alignment:['left','top']} , \n\t\t\t\t\t\t\t\t    closeBtn: Button {text:'Close', alignment:['right','top']} ,\n\t\t\t\t\t\t\t\t},\n                 }";
    helpWin.grp = helpWin.add(res);
    helpWin.layout.layout(true);
    helpWin.layout.resize();
    if (myPalette.grp.headerGroup.visible == true) {
      helpWin.grp.helpTabbedPanel.settingsTab.hideSectionGroup.hideHeaderImg.value = false;
    } else {
      helpWin.grp.helpTabbedPanel.settingsTab.hideSectionGroup.hideHeaderImg.value = true;
    }
    helpWin.grp.helpTabbedPanel.descriptionTab.descriptionTextBox.text =
      descriptionText + "\n \n" + usageText;
    helpWin.grp.btnGroup.websiteBtn.onClick = function () {
      openURL(websiteUrl);
    };
    helpWin.grp.btnGroup.checkUpdateBtn.onClick = function () {
      openURL(productUrl);
    };
    helpWin.grp.btnGroup.closeBtn.onClick = function () {
      app.settings.saveSetting(
        scriptTitle,
        "Hide header image",
        helpWin.grp.helpTabbedPanel.settingsTab.hideSectionGroup.hideHeaderImg
          .value
      );
      helpWin.close();
    };
    helpWin.grp.helpTabbedPanel.settingsTab.hideSectionGroup.hideHeaderImg.onClick =
      function () {
        if (
          helpWin.grp.helpTabbedPanel.settingsTab.hideSectionGroup.hideHeaderImg
            .value == true
        ) {
          myPalette.grp.headerGroup.visible = false;
          myPalette.grp.headerGroup.maximumSize = [0, 0];
          myPalette.layout.layout(true);
        } else {
          myPalette.grp.headerGroup.visible = true;
          myPalette.grp.headerGroup.maximumSize = [200, 30];
          myPalette.grp.headerGroup.alignment = ["left", "top"];
          myPalette.layout.layout(true);
        }
      };
    helpWin.show();
    helpWin.onResizing = helpWin.onResize = function () {
      this.layout.resize();
    };
  }
}
function openURL(url) {
  if ($.os.indexOf("Windows") != -1) {
    system.callSystem(
      'cmd /c "' +
        Folder.commonFiles.parent.fsName +
        "\\Internet Explorer\\iexplore.exe" +
        '" ' +
        url
    );
  } else {
    var cmd = 'open "' + url + '"';
    system.callSystem(cmd);
  }
}
